  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Devils Lake Wetland
  Management District outlines Refuge accomplishments for the calendar year of 1966.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover conditions during the year. Wildlife- including migratory
  birds, upland game birds, big game animals, fur animals, predators, and rodents-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, vegetation control, and fires. Resource management is outlined;
  topics include grazing and fur harvesting. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, hunting, violations,
  and safety. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
